import React from "react";
import Blog from './blog.jsx';
import Cont from './Content.jsx';

function App(){
    return(
    <div>
        {Cont.map((value, index) => {
            <Blog
                img={Cont.img}
                content={Cont.content}
                title={Cont.title}
            />
        })}

    </div>
    );
}

export default App;
